import React from "react";

const DeptRow = ({ dept }) => {
    return (
        <tr>
            <th>User ID #</th>
            <th>Name</th>
            <th>Labs</th>
            <th># of submitted tickets</th>
        </tr>
    )
}

export default DeptRow;
